var $bm_rt;
var colorArray, rc, an, cc, mainColor, randomColor, toggle;
try {
    var FM_controllerComp = thisComp;
    var FM_controllerLayer = FM_controllerComp.layer('Controller');
    colorArray = [
        '1',
        '2',
        '3',
        '4',
        '5',
        '6'
    ];
    rc = effect('Random Color')('Slider');
    an = colorArray[parseInt(rc)];
    cc = [parseInt(an)];
    mainColor = FM_controllerLayer.effect('Hypernova Controller')('Color 01');
    randomColor = FM_controllerLayer.effect('Hypernova Controller')($bm_sum('Random Color 0', parseInt(cc)));
    $bm_rt = toggle = FM_controllerLayer.effect('Hypernova Controller')('Use Random Colors');
    if (toggle == 1) {
        $bm_rt = randomColor;
    } else {
        $bm_rt = mainColor;
    }
} catch (e) {
    $bm_rt = value;
}

