var $bm_rt;
var prevRandom, x;
try {
    var FM_controllerComp = thisComp;
    var FM_controllerLayer = FM_controllerComp.layer('Controller');
    prevRandom = thisComp.layer('G 01').effect('Random Color')('Slider');
    seedRandom(FM_controllerLayer.effect('Hypernova Controller')('Random Seed'), true);
    $bm_rt = x = random(0, 5).toFixed(0);
    if (prevRandom == x) {
        $bm_rt = $bm_sub(x, -1);
    } else {
        $bm_rt = x;
    }
} catch (e) {
    $bm_rt = value;
}

